import React from 'react';

class InterviewCard extends React.Component {
    constructor() {
        super();
    }


    render() {
        const { interviewList } = this.props;

        return (
            <div className="interview-card">
                <table striped bordered hover>
                    <thead>
                    <tr>
                        <th>#</th>
                        <th>First Name</th>
                        <th>Last Name</th>
                        <th>Username</th>
                    </tr>
                    </thead>
                    <tbody>
                        {interviewList.map((interview,id) => <tr key={id}>{interview.company}</tr>)}
                    </tbody>
                </table>
            </div>
        )
    }

}

export default InterviewCard;
